}

interface Router {
    function getAmountsOut(uint amountIn, address[] memory path) external
        view
        returns (uint[] memory amounts);
}

contract LpUtils {
    address public WBNB = 0xae13d989daC2f0dEbFf460aC112a837C89BAa7cd;
    address public BUSD = 0x78867BbEeF44f2326bF8DDd1941a4439382EF2A7;
    uint256 amount = 1000000000000000000;

    function price(Router routerAddress, address token) internal view returns(uint){
        address[] memory path = new address[](3);
        path[0] = token;
        path[1] = WBNB;
        path[2] = BUSD;
        return routerAddress.getAmountsOut(amount,path)[2];
    }

    function CalcLpPrice(IERC20 lpAddress, Router routerAddress) external view returns(uint256){

        uint256 phase1 = (lpAddress.balanceOf(lpAddress.token0())*price(routerAddress,lpAddress.token0()));
        uint256 phase2 = (lpAddress.balanceOf(lpAddress.token1())*price(routerAddress,lpAddress.token1()));
        
        return (phase1 + phase2);
